f you needed it?',0,0,0,NULL,'2015-04-08 17:56:49',1180,5,NULL,'ACE5'),(1185,2,'Were your parents ever separated or divorced?',0,0,0,NULL,'2015-04-08 17:59:43',1190,1,NULL,'ACE6'),(1186,2,'Was your mother or stepmother: Often or very often pushed, grabbed, slapped, or had something thrown at her? OR Sometimes, often, or very often kicked, bitten, hit with a fist, or hit with something hard? OR Ever repeatedly hit at least a few minutes or threatened with a gun or knife?',0,0,0,NULL,'2015-04-08 17:59:43',1190,2,NULL,'ACE7'),(1187,2,'Did you live with anyone who was a problem drinker or alcoholic or who used street drugs?',0,0,0,NULL,'2015-04-08 17:59:43',1190,3,NULL,'ACE8'),(1188,2,'Was a household member depressed or mentally ill, or did a household member attempt suicide?',0,0,0,NULL,'2015-04-08 17:59:43',1190,4,NULL,'ACE9'),(1189,2,'Did a household member go to prison?',0,0,0,NULL,'2015-04-08 17:59:43',1190,5,NULL,'ACE10'),(1190,6,'While you were growing up, during your first 18 years of life:',0,0,0,NULL,'2015-04-08 17:59:43',NULL,1,NULL,''),(1191,8,'<p>We are interested in finding out about the kinds of physical activities that people do as a part of their everyday lives. The questions will ask you about the time you spent being physically active in the <b><u>last 7 days</u></b>. Please answer each question even if you do not consider yourself to be an active person. Please think about the activities you do at work, as a part of your house and yard work, to get from place to place, and in your spare time for recreation, exercise or sport. <br></p>',0,0,0,NULL,'2015-04-08 18:07:05',NULL,1,NULL,''),(1192,1,'During the last 7 days, on how many days did you do vigorous physical activities like heavy lifting, digging, aerobics, or fast bicycling? (days per week)',0,0,0,NULL,'2015-04-08 18:08:51',NULL,2,NULL,'PAQ1'),(1193,2,'Days per week',0,0,0,NULL,'2015-04-08 18:21:35',NULL,4,NULL,'PAQ1'),(1194,8,'<p>Think about all the <b>vigorous</b> activities that you did in the last <b>7 days</b>.&nbsp; <b>Vigorous </b>physical activities refer to activities that take hard physical effort and make you breathe much harder than normal.&nbsp; Think only about those physical activities that you did for at least 10 minutes at a time.<br></p>',0,0,0,NULL,'2015-04-08 18:25:02',NULL,2,NULL,''),(1197,8,'During the <b>last 7 days</b>, on how many days did you do <b>vigorous</b> physical activities like heavy lifting, digging, aerobics, or fast bicycling?',0,0,0,NULL,'2015-04-08 18:29:42',NULL,3,NULL,''),(1198,8,'<p>How much time did you spend doing <b>vigorous</b> physical activities on one of those days?<br></p>',0,0,0,NULL,'2015-04-08 18:31:49',NULL,5,NULL,''),(1199,1,'Hours per day',0,0,0,NULL,'2015-04-08 18:36:29',NULL,6,NULL,'IPAQ2_vighours'),(1200,1,'Minutes per day',0,0,0,NULL,'2015-04-08 18:37:07',NULL,7,NULL,'IPAQ2_vigmin'),(1201,1,'Days per week',0,0,0,NULL,'2015-04-08 18:38:09',NULL,4,NULL,'IPAQ1_vigdays'),(1202,1,'Think about all the moderate activities that you did in the last 7 days.  Moderate activities refer to activities that take moderate physical effort and make you breathe somewhat harder than normal.  Think only about those physical activities that you did for at least 10 minutes at a time.',0,0,0,NULL,'2015-04-08 18:44:27',NULL,2,NULL,''),(1203,8,'<p>Think about all the <b>moderate</b> activities that you did in the <b>last 7 days.  Moderate </b>activities refer to activities that take moderate physical effort and make you breathe somewhat harder than normal.  Think only about those physical activities that you did for at least 10 minutes at a time.</p>',0,0,0,NULL,'2015-04-08 18:46:33',NULL,2,NULL,''),(1204,8,'<p>Think about all the <b>moderate</b> activities that you did in the last <b>7 days</b>. <b> Moderate </b>activities refer to activities that take moderate physical effort and make you breathe somewhat harder than normal.  Think only about those physical activities that you did for at least 10 minutes at a time.</p>',0,0,0,NULL,'2015-04-08 18:48:27',NULL,1,NULL,''),(1207,8,'<p>During the <b>last 7 days</b>, on how many days did you do <b>moderate</b> physical activities like carrying light loads, bicycling at a regular pace, or doubles tennis?  Do not include walking.</p>',0,0,0,NULL,'2015-04-08 18:49:31',NULL,2,NULL,''),(1208,1,'Days per week',0,0,0,NULL,'2015-04-08 18:50:08',NULL,3,NULL,'IPAQ3_moddays'),(1209,8,'<p>How much time did you usually spend doing <b>moderate</b> physical activities on one of those days?</p>',0,0,0,NULL,'2015-04-08 18:50:53',NULL,4,NULL,''),(1210,1,'Hours per day',0,0,0,NULL,'2015-04-08 18:51:21',NULL,5,NULL,'IPAQ4_modhours'),(1211,1,'Minutes per day',0,0,0,NULL,'2015-04-08 18:51:49',NULL,6,NULL,'IPAQ4_modmin'),(1212,8,'<p>Think about the time you spent <b>walking</b> in the <b>last 7 days</b>.  This includes at work and at home, walking to travel from place to place, and any other walking that you have done solely for recreation, sport, exercise, or leisure.</p>',0,0,0,NULL,'2015-04-08 18:52:25',NULL,1,NULL,''),(1213,8,'<p>During the l<b>ast 7 days</b>, on how many days did you <b>walk</b> for at least 10 minutes at a time?</p>',0,0,0,NULL,'2015-04-08 18:53:12',NULL,2,NULL,''),(1214,1,'Days per week',0,0,0,NULL,'2015-04-08 18:53:50',NULL,3,NULL,'IPAQ5_walkdays'),(1215,1,'Hours per day',0,0,0,NULL,'2015-04-08 18:55:54',NULL,5,NULL,'IPAQ6_walkhours'),(1216,8,'<p>How much time did you usually spend doing <b>moderate</b> physical activities on one of those days?</p>',0,0,0,NULL,'2015-04-08 18:55:54',NULL,7,NULL,''),(1217,8,'<p>How much time did you usually spend <b>walking</b> on one of those days?</p>',0,0,0,NULL,'2015-04-08 18:57:27',NULL,4,NULL,''),(1218,1,'Minutes per day',0,0,0,NULL,'2015-04-08 18:58:08',NULL,6,NULL,'IPAQ6_walkmin'),(1219,8,'<p>The last question is about the time you spent <b>sitting</b> on weekdays during the <b>last 7 days</b>.  Include time spent at work, at home, while doing course work and during leisure time.  This may include time spent sitting at a desk, visiting friends, reading, or sitting or lying down to watch television.</p>',0,0,0,NULL,'2015-04-08 18:58:55',NULL,1,NULL,''),(1220,8,'<p>During the <b>last 7 days</b>, how much time did you spend <b>sitting</b> on a <b>week day</b>?</p>',0,0,0,NULL,'2015-04-08 18:59:30',NULL,2,NULL,''),(1221,1,'Hours per day',0,0,0,NULL,'2015-04-08 18:59:53',NULL,3,NULL,'IPAQ7_sithours'),(1222,1,'Minutes per day',0,0,0,NULL,'2015-04-08 19:00:27',NULL,4,NULL,'IPAQ7_sitmin'),(1223,8,'<p>1.) <b>Predeployment Life Events </b><br></p><p><br></p><p>The statements below refer to the events you may have experienced AT ANY TIME BEFORE YOUR MOST RECENT DEPLOYMENT. <b>Please mark \"Yes\" or \"No\" for each question below.\n</b></p>',0,0,0,NULL,'2015-04-08 19:15:45',NULL,1,NULL,''),(1224,2,'Someone close to me died.',0,0,0,NULL,'2015-04-08 19:19:37',1231,1,NULL,'DRRIPreLE1'),(1225,2,'I went through a divorce or was left by a significant other.',0,0,0,NULL,'2015-04-08 19:19:37',1231,2,NULL,'DRRIPreLE2'),(1226,2,'I was robbed or had my home broken into.',0,0,0,NULL,'2015-04-08 19:19:37',1231,3,NULL,'DRRIPreLE3'),(1227,2,'I saw or heard physical fighting between my parents or caregivers.',0,0,0,NULL,'2015-04-08 19:19:37',1231,4,NULL,'DRRIPreLE4'),(1228,2,'I was physically punished by a parent or primary caregiver.',0,0,0,NULL,'2015-04-08 19:19:37',1231,5,NULL,'DRRIPreLE5'),(1229,2,'I experienced unwanted sexual activity as a result of force, threat of harm, or manipulation during childhood (before age 18).',0,0,0,NULL,'2015-04-08 19:19:37',1231,6,NULL,'DRRIPreLE6'),(1230,2,'I experienced unwanted sexual activity as a result of force, threat of harm, or manipulation during adulthood (age 18 or later).',0,0,0,NULL,'2015-04-08 19:19:37',1231,7,NULL,'DRRIPreLE7'),(1231,6,'Before I was deployed:',0,0,0,NULL,'2015-04-08 19:19:37',NULL,2,NULL,''),(1232,8,'The statements below refer to the events you may have experienced AT ANY TIME BEFORE YOUR MOST RECENT DEPLOYMENT. <b>P