,1246,3,NULL,'DRRIPreLE17'),(1245,2,'I experienced stressful legal problems (for example, being sued, suing someone else, or being in a custody battle).',0,0,0,NULL,'2015-04-08 19:24:22',1246,4,NULL,'DRRIPreLE18'),(1246,6,'',0,0,0,NULL,'2015-04-08 19:24:22',NULL,2,NULL,''),(1247,8,'<p><b>2.)  Childhood Family Experiences </b><br></p><p><br></p><p>\nThe sentences below refer to your relationship with your family WHEN YOU WERE GROWING UP. Please describe how much you agree or disagree with each statement by marking ONE response that best fits your choice. <b> If you spent time in more than one family setting, please answer these questions about the family in which you spent the greatest part of your childhood.</b></p>',0,0,0,NULL,'2015-04-08 19:25:22',NULL,1,NULL,''),(1248,2,'I got along well with my family members.',0,0,0,NULL,'2015-04-08 19:29:26',1255,1,NULL,'DRRICFE1'),(1249,2,'I felt like I fit in with my family.',0,0,0,NULL,'2015-04-08 19:29:26',1255,2,NULL,'DRRICFE2'),(1250,2,'Family members knew what I thought and how I felt about things.',0,0,0,NULL,'2015-04-08 19:29:26',1255,3,NULL,'DRRICFE3'),(1251,2,'I felt like my contributions to my family were appreciated.',0,0,0,NULL,'2015-04-08 19:29:26',1255,4,NULL,'DRRICFE4'),(1252,2,'I shared many common interests and activities with family members.',0,0,0,NULL,'2015-04-08 19:29:26',1255,5,NULL,'DRRICFE5'),(1253,2,'My opinions were valued by other family members.',0,0,0,NULL,'2015-04-08 19:29:26',1255,6,NULL,'DRRICFE6'),(1254,2,'I was affectionate with family members.',0,0,0,NULL,'2015-04-08 19:29:26',1255,7,NULL,'DRRICFE7'),(1255,6,'',0,0,0,NULL,'2015-04-08 19:29:26',NULL,2,NULL,''),(1256,8,'The sentences below refer to your relationship with your family WHEN YOU\n WERE GROWING UP. Please describe how much you agree or disagree with \neach statement by marking ONE response that best fits your choice. <b> \nIf you spent time in more than one family setting, please answer these \nquestions about the family in which you spent the greatest part of your \nchildhood.</b>\n				',0,0,0,NULL,'2015-04-08 21:03:46',NULL,1,NULL,''),(1257,2,'I played an important role in my family.',0,0,0,NULL,'2015-04-08 21:06:27',1262,1,NULL,'DRRICFE8'),(1258,2,'I spent as much of my free time with family members as possible.',0,0,0,NULL,'2015-04-08 21:06:27',1262,2,NULL,'DRRICFE9'),(1259,2,'Family members told me when they were having a problem.',0,0,0,NULL,'2015-04-08 21:06:27',1262,3,NULL,'DRRICFE10'),(1260,2,'I could be myself around family members.',0,0,0,NULL,'2015-04-08 21:06:27',1262,4,NULL,'DRRICFE11'),(1261,2,'My input was sought on important family decisions.',0,0,0,NULL,'2015-04-08 21:06:27',1262,5,NULL,'DRRICFE12'),(1262,6,'',0,0,0,NULL,'2015-04-08 21:06:27',NULL,2,NULL,''),(1263,8,'<p><b>3.)  Deployment Environment </b><br></p><p><br></p><p>The next set of statements is about the conditions of day-to-day life <b>DURING YOUR MOST RECENT DEPLOYMENT</b>. Please read each statement and describe what amount of time you were exposed to each condition over the course of the entire time of your most recent deployment. <b>Please circle ONE response that best fits your choice.</b></p>',0,0,0,NULL,'2015-04-08 21:07:27',NULL,1,NULL,''),(1264,2,'The climate was uncomfortable.',0,0,0,NULL,'2015-04-08 21:10:41',1271,1,NULL,'DRRIDE1'),(1265,2,'I had to deal with annoying animals, insects, or plants.',0,0,0,NULL,'2015-04-08 21:10:41',1271,2,NULL,'DRRIDE2'),(1266,2,'The food I had to eat was of very poor quality (for example, bad or old MREs).',0,0,0,NULL,'2015-04-08 21:10:41',1271,3,NULL,'DRRIDE3'),(1267,2,'The conditions I lived in were extremely unsanitary.',0,0,0,NULL,'2015-04-08 21:10:41',1271,4,NULL,'DRRIDE4'),(1268,2,'I didn\'t have access to bathrooms or showers when I needed them.',0,0,0,NULL,'2015-04-08 21:10:41',1271,5,NULL,'DRRIDE5'),(1269,2,'I wasn\'t able to get as much privacy as I needed.',0,0,0,NULL,'2015-04-08 21:10:41',1271,6,NULL,'DRRIDE6'),(1270,2,'I was exposed to awful smells.',0,0,0,NULL,'2015-04-08 21:10:41',1271,7,NULL,'DRRIDE7'),(1271,6,'',0,0,0,NULL,'2015-04-08 21:10:41',NULL,2,NULL,''),(1272,8,'<p>The next set of statements is about the conditions of day-to-day life <b>DURING YOUR MOST RECENT DEPLOYMENT</b>.\n Please read each statement and describe what amount of time you were \nexposed to each condition over the course of the entire time of your \nmost recent deployment. <b>Please circle ONE response that best fits your choice.</b></p>',0,0,0,NULL,'2015-04-08 21:14:59',NULL,1,NULL,''),(1273,2,'I was subjected to loud noises.',0,0,0,NULL,'2015-04-08 21:14:59',1280,1,NULL,'DRRIDE8'),(1274,2,'My daily activities were restricted because of local religious or ethnic customs.',0,0,0,NULL,'2015-04-08 21:14:59',1280,2,NULL,'DRRIDE9'),(1275,2,'I wasn\'t able to get rest when I needed it.',0,0,0,NULL,'2015-04-08 21:14:59',1280,3,NULL,'DRRIDE10'),(1276,2,'I wasn\'t able to contact home when I needed to.',0,0,0,NULL,'2015-04-08 21:14:59',1280,4,NULL,'DRRIDE11'),(1277,2,'I had to hassle with putting on and taking off heavy or annoying gear.',0,0,0,NULL,'2015-04-08 21:14:59',1280,5,NULL,'DRRIDE12'),(1278,2,'I was not allowed to do the things I needed to do to get my job done.',0,0,0,NULL,'2015-04-08 21:14:59',1280,6,NULL,'DRRIDE13'),(1279,2,'I did not have adequate shelter from uncomfortable living conditions (for example, heat, cold, wet, etc.).',0,0,0,NULL,'2015-04-08 21:14:59',1280,7,NULL,'DRRIDE14'),(1280,6,'',0,0,0,NULL,'2015-04-08 21:14:59',NULL,2,NULL,''),(1281,8,'<p><b>4.)  Combat Experiences\n\n<br></b></p><p><br></p><p>The statements below are about your combat experiences during your most recent deployment. As used in these statements, the term \"unit\" refers to those you lived and worked with on a daily basis during deployment.  <b>Please mark how often you experienced each circumstance by circling ONE response that best fits your choice.</b></p>',0,0,0,NULL,'2015-04-08 21:16:03',NULL,1,NULL,''),(1282,2,'I went on combat patrols or missions.',0,0,0,NULL,'2015-04-08 21:19:06',1289,1,NULL,'DRRICE1'),(1283,2,'I took part in an assault on entrenched or fortified positions that involved naval and/or land forces.',0,0,0,NULL,'2015-04-08 21:19:06',1289,2,NULL,'DRRICE2'),(1284,2,'I personally witnessed someone from my unit or an ally unit being seriously wounded or killed.',0,0,0,NULL,'2015-04-08 21:19:06',1289,3,NULL,'DRRICE3'),(1285,2,'I encountered land or water mines, booby traps, or roadside bombs (for example, IEDs).',0,0,0,NULL,'2015-04-08 21:19:06',1289,4,NULL,'DRRICE4'),(1286,2,'I was exposed to hostile incoming fire.',0,0,0,NULL,'2015-04-08 21:19:06',1289,5,NULL,'DRRICE5'),(1287,2,'I was exposed to \"friendly\" incoming fire.',0,0,0,NULL,'2015-04-08 21:19:06',1289,6,NULL,'DRRICE6'),(1288,2,'I was in a vehicle (for example, a \"Humvee\", helicopter, or boat) or part of a convoy that was attacked.',0,0,0,NULL,'2015-04-08 21:19:06',1289,7,NULL,'DRRICE7'),(1289,6,'While Deployed:',0,0,0,NULL,'2015-04-08 21:19:06',NULL,2,NULL,''),(1290,8,'The statements below are about your combat experiences during your most \nrecent deployment. As used in these statements, the term \"unit\" refers \nto those you lived and worked with on a daily basis during deployment.  <b>Please mark how often you experienced each circumstance by circling ONE response that best fits your choice.</b><p><br></p>',0,0,0,NULL,'2015-04-08 21:19:23',NULL,1,NULL,''),(1291,2,'I was part of a land or naval artillery unit that fired on enemy combatants.',0,0,0,NULL,'2015-04-08 21:22:32',1298,1,NULL,'DRRICE8'),(1292,2,'I personally witnessed enemy combatants being seriously wounded or killed.',0,0,0,NULL,'2015-04-08 21:22:32',1298,2,NULL,'DRRICE9'),(1293,2,'I personally witnessed civilians (for example, women and children) being seriously wounded or killed.',0,0,0,NULL,'2015-04-08 21:22:32',1298,3,NULL,'DRRICE10'),(1294,2,'I was injured in a combat-related incident.',0,0,0,NULL,'2015-04-08 21:22:32',1298,4,NULL,'DRRICE11'),(1295,2,'I fired my