INSERT INTO `template` VALUES (1,1,'OOO Battery CPRS Note Introduction','OOO Battery CPRS Note Introduction','<#include \"clinicalnotefunctions\"> ${MODULE_TITLE_START} INTRODUCTION: ${MODULE_TITLE_END} <#-- Template start --> ${MODULE_START} <#assign section1> <#if hasValue(getCustomVariableDisplayText(var1)) > The Veteran presented to enroll in the VA Healthcare System and consented to be screened using the electronic version v${getCustomVariableDisplayText(var1)} of the Post-911 Screening Packet.${NBSP} </#if> <#if hasValue(getCustomVariableDisplayText(var2)) > The eScreening was administered by ${getCustomVariableDisplayText(var2)}.${NBSP} </#if> <#if hasValue(getCustomVariableDisplayText(var3)) > The results were used to auto-generate a CPRS note and reviewed by ${getCustomVariableDisplayText(var3)}.${NBSP} </#if> </#assign> <#if !(section1 = \"\") > ${section1} <#else> ${noParagraphData} </#if> ${MODULE_END}','2014-12-23 23:47:33',0,NULL,NULL,NULL),(2,2,'OOO Battery CPRS Note Footer','OOO Battery CPRS Note Footer','<#include \"clinicalnotefunctions\"> \n<#-- Template start -->\n${MODULE_TITLE_START}\nINTERVENTIONS: \n${MODULE_TITLE_END}\n${MODULE_START}\n	\n 	<#assign footer_section>\n\n		<#assign outputText = \"\">\n		<#assign errorText = \"\">\n		<#assign incompleteText = \"All of the required information has not been provided.\">\n\n		<#assign outputText = outputText + \"${LINE_BREAK}*Explained confidentiality and the limits of confidentiality.${LINE_BREAK}\">\n\n		<#assign part = \"\">\n\n		<#assign outputText = outputText + \"*Educated the Veteran on VA health care benefits and OEF/OIF care coordination services.${LINE_BREAK}\n												*OEF/OIF Case Management not indicated at this time.${LINE_BREAK}\">\n		\n		<#if ((var202.value)?? && var202.value == \"true\") || ((var9060.value)?? && var9060.value == \"true\")>\n				<#assign outputText = outputText + \"*Veteran endorsed mental health concerns, recommend outpatient consult to Psychiatry for MH.${LINE_