TRIX_TH_START}Result${MATRIX_TH_END} ${MATRIX_TH_START}Raw Score${MATRIX_TH_END} ${MATRIX_TH_START}Cut-off Score${MATRIX_TH_END} ${MATRIX_TR_END} ${MATRIX_TR_START} <#list rows as row> ${MATRIX_TR_START} <#list row as col> ${MATRIX_TD_START}${col}${MATRIX_TD_END} </#list> ${MATRIX_TR_END} </#list> ${MATRIX_TR_END} ${MATRIX_TABLE_END} ${MODULE_END}','2015-02-21 14:15:05',0,NULL,NULL,NULL),(220,7,'Veteran Summary Footer','Veteran Summary Footer','<#include \"clinicalnotefunctions\"> <#-- Template start --> ${MODULE_START} <table> <tr> <td class=\"justifyCtrTableData\">For online information about support services and benefits, visit the VA Center of Excellence resource site:</td> </tr> <tr> <td class=\"justifyCtrTableData\">http://escreening.cesamh.org</td> </tr> <tr class=\"justifyCtrTableData\"> <td class=\"justifyCtrTableData\"><img src=\"resources/images/escreening_cdsmith_QR_code_small.png\"></td> </tr> <tr> <td class=\"justifyLftTableData\">For confidential help and support any time, call the Veteran\'s Suicide Prevention/Crisis Hotline at (800) 273-8255. The Hotline is never closed; someone is always there to take your call, even on holidays and in the middle of the night. </td> </tr> </table> <br/> <br/> <div style=\"text-align: center;\"><span style=\"font-size:11px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">DEPARTMENT OF VETERANS AFFAIRS</span></span></div> <div style=\"text-align: center;\"><span style=\"font-size:11px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">VA San Diego Healthcare System I 3350 La Jolla Village Dr. I San Diego, CA 92161</span></span></div> ${MODULE_END}','2015-02-21 14:15:09',0,NULL,NULL,NULL),(300,8,'Veteran Summary Advance Directive Entry','Veteran Summary Advance Directive Entry',' <#include \"clinicalnotefunctions\"> <#-- Template start --> ${MODULE_TITLE_START} Advance Directive ${MODULE_TITLE_END} ${MODULE_START}  This is a legal paper that tells your wishes for treatment if you become too sick to talk, and if needed, can help your doctors and family to make decisions about your care. ${LINE_BREAK} ${LINE_BREAK} <b>Results:</b>${NBSP} <#if !(var820.children)?? || ((var820.children)?size == 0)> Declined ${LINE_BREAK} <b>Recommendations:</b> Call VA Social Work Service at (858) 552-8585 ext. 3500, and ask for help in creating and filing an advance directive. <#elseif isSelectedAnswer(var820,var821)> Incomplete ${LINE_BREAK} <b>Recommendations:</b> Call VA Social Work Service at (858) 552-8585 ext. 3500, and ask for help in creating and filing an advance directive. <#elseif isSelectedAnswer(var820,var822)> Complete </#if> ${MODULE_END}','2015-02-21 14:15:09',0,NULL,NULL,NULL),(301,8,'Veteran Summary Homelessness Entry','Veteran Summary Homelessness Entry','<#include \"clinicalnotefunctions\"> <#-- Template start --> ${MODULE_TITLE_START} Homelessness ${MODULE_TITLE_END} ${MODULE_START} This is when you do not have a safe or stable place you can return to every night. The VA is committed to ending Veteran homelessness by the end of 2015. ${LINE_BREAK} ${LINE_BREAK} <b>Results:</b>${NBSP}  <#if isSelectedAnswer(var2000, var761) || ( isSelectedAnswer(var2000, var762) && isSelectedAnswer(var2001, var772) ) > unstable housing/at risk ${LINE_BREAK} <b>Recommendation:</b> Call the VA\'s free National Call Center for Homeless Veterans at (877)-424-3838 and ask for help. Someone is always there to take your call. <#elseif isSelectedAnswer(var2000, var762) && isSelectedAnswer(var2001, var771)> stable housing <#else> declined </#if> ${MODULE_END}','2015-02-21 14:15:09',0,NULL,NULL,NULL),(302,8,'Veteran Summary Alcohol Use Entry','Veteran Summary Alcohol Use Entry',' <#include \"clinicalnotefunctions\"> ${MODULE_TITLE_START} Alcohol Use ${MODULE_TITLE_END} ${MODULE_START} Drinking too much, too often, or both, causes serious problems. Abuse can have negative effects on school, work, and relationships, and can cause liver disease and cirrhosis, congestive heart failure, seizures, falls, hypertension, and other serious health risks. ${LINE_BREAK} ${LINE_BREAK} <b>Results:</b> ${NBSP} <#if (var1229??) &&  getFormulaDisplayText(var1229) != \"notfound\"> <#if getFormulaDisplayText(var1229)?number <= 2 > negative screen <#else> at risk </#if> <#else> declined </#if> ${LINE_BREAK} <b>Recommendation:</b> If female, limit yourself to one drink a day; if male, limit yourself to 2 drinks a day. If this is difficult, ask your clinician for help with managing your drinking. ${MODULE_END} ','2015-02-21 14:15:09',0,NULL,NULL,NULL),(303,8,'Veteran Summary Insomnia Entry','Veteran Summary Insomnia Entry',' <#include \"clinicalnotefunctions\"> <#-- Template start --> <#if var2189?? && getFormulaDisplayText(var2189) != \"notfound\"> ${MODULE_TITLE_START} Insomnia ${MODULE_TITLE_END} ${MODULE_START} Insomnia is having trouble sleeping that lasts longer than a few weeks. Some causes are: medical (like depression or pain), lifestyle factors (such as too much caffeine), or even stress. ${LINE_BREAK} ${LINE_BREAK} <b>Results:</b>${NBSP} <#if (getFormulaDisplayText(var2189)?number >= 0) && (getFormulaDisplayText(var2189)?number <= 7)> negative screen <#elseif (getFormulaDisplayText(var2189)?number >= 8) && (getFormulaDisplayText(var2189)?number <= 14)> subthreshold insomnia <#elseif (getFormulaDisplayText(var2189)?number >= 15) && (getFormulaDisplayText(var2189)?number <= 21)> moderate insomnia <#elseif (getFormulaDisplayText(var2189)?number >= 22) && (getFormulaDisplayText(var2189)?number <= 28)> severe insomnia </#if> <#if (getFormulaDisplayText(var2189)?number >= 15)> ${LINE_BREAK} <b>Recommendation:</b> Describe your sleeping problems to your clinician, or learn more about insomnia at the  CESAMH site at: http://escreening.cesamh.org </#if> ${MODULE_END} </#if> ','2015-02-21 14:15:09',0,NULL,NULL,NULL),(304,8,'Veteran Summary Environmental Exposure Entry','Veteran Summary Environmental Exposure Entry',' <#include \"clinicalnotefunctions\"> <#-- Template start --> ${MODULE_TITLE_START} Environmental Exposure ${MODULE_TITLE_END} ${MODULE_START} This is when you have been exposed to a hazard that may have potential health risks. ${LINE_BREAK} ${LINE_BREAK} <b>Results:</b> ${NBSP}  <#if (var10540.children)??  && ((var10540.children)?size > 0)> <#if isSelectedAnswer(var10540,var10541)> none reported <#elseif isSelectedAnswer(var10540,var10542)> at risk ${LINE_BREAK} <b>Recommendation:</b> Call Dale Willoughby at the Environmental Registry Program and discuss your exposure: (858) 642-3995, weekdays 7:30am-4:00pm. </#if> <#else> skipped </#if> ${MODULE_END} ','2015-02-21 14:15:09',0,NULL,NULL,NULL),(305,8,'Veteran Summary Military Sexual Trauma (MST) Entry','Veteran Summary Military Sexual Trauma (MST) Entry',' <#include \"clinicalnotefunctions\"> <#-- Template start --> <#if (var2003.children)?? && ((var2003.children)?size > 0)> ${MODULE_TITLE_START} Military Sexual Trauma (MST) ${MODULE_TITLE_END} ${MODULE_START} MST is sexual assault or repeated, threatening sexual harassment that occurred while the Veteran was in the military. MST can happen any time or anywhere, to men and women. MST can affect your physical and mental health, even years later. ${LINE_BREAK} ${LINE_BREAK} <b>Results:</b>${NBSP} <#if isSelectedAnswer(var2003,var2004)> negative screen ${LINE_BREAK} <b>Recommendation:</b> none <#elseif isSelectedAnswer(var2003,var2005)> postive screen ${LINE_BREAK} <b>Recommendation:</b> Ask your clinician for help managing your MST. <#elseif isSelectedAnswer(var2003,var2006)> declined to answer </#if> ${MODULE_END} </#if> ','2015-02-21 14:15:09',0,NULL,NULL,NULL),(306,8,'Veteran Summary Tobacco Use Entry','Veteran Summary Tobacco Use Entry','<#include \"clinicalnotefunctions\"> <#-- Template start --> ${MODULE_TITLE_START} Tobacco Use ${MODULE_TITLE_END}  ${MODULE_START} The use of tobacco causes harm to nearly every organ in the body. Quitting greatly lowers your risk of death from cancers, heart disease, stroke, and emphysema. There are many options, such as in-person and telephone counseling, nicotine replacement, and prescription medications.  ${LINE_BREAK} ${LINE_BREAK}  <b>Results:</b>${NBSP}  <#if (var600.children)?? && ((var600.children)?size gt 0)> <#if isSelectedAnswer(var600,var601) || isSelectedAnswer(var600,var602)> negative screen <#elseif isSelectedAnswer(var600,var603)> current user ${LINE_BREAK} <b>Recommendations:</b> Prepare a plan to reduce or quit the use of tobacco. Get support from family and friends, and ask your clinician for help if needed. </#if> <#else> ${NBSP}Veteran declined to respond </#if> ${MODULE_END}','2015-02-21 14:15:09',0,NULL,NULL,NULL),(307,8,'Veteran Summary Traumatic Brain Injury (TBI) Entry','Veteran Summary Traumatic Brain Injury (TBI) Entry','<#include \"clinicalnotefunctions\"> <#function calcScore obj> <#assign result = 0> <#if (obj.children)?? && ((obj.children)?size > 0)> <#list obj.children as c> <#if c.overrideText != \"none\"> <#assign result = result + 1> <#break> </#if> </#list> </#if> <#return result> </#function>  <#assign score = 0> <#assign isQ2Complete = false> <#assign isQ2None = false>  <#if (var3400.children)?? && ((var3400.children)?size > 0)> <#assign isQ2Complete = true> <#if isSelectedAnswer(var3400, var2016)!false> <#assign isQ2None = true> <#else> <#assign score = score + calcScore(var3400)> </#if> </#if>  <#assign isQ3Complete = false> <#assign isQ3None = false>  <#if isQ2Complete> <#if isQ2None> <#assign isQ3Complete = true> <#else> <#if (var3410.children)?? && ((var3410.children)?size > 0) > <#if isSelectedAnswer(var3410, var2022)!false> <#assign isQ3None = true> <#else> <#assign score = score + calcScore(var3410)> </#if> <#assign isQ3Complete = true> </#if> </#if> </#if>  <#assign isQ4Complete = false> <#assign isQ4None = false>  <#if isQ3Complete> <#if isQ2None || isQ3None> <#assign isQ4Complete = true> <#else> <#if (var3420.children)?? && ((var3420.children)?size > 0) > <#if isSelectedAnswer(var3420, var2030)!false> <#assign isQ4None = true> <#else> <#assign score = score + calcScore(var3420)> </#if> <#assign isQ4Complete = true> </#if> </#if> </#if>  <#assign isQ5Complete = false> <#assign isQ5None = false> <#if isQ4Complete> <#if isQ2None || isQ3None || isQ4None> <#assign isQ5Complete = true> <#else> <#if (var3430.children)?? && ((var3430.children)?size > 0) > <#if isSelectedAnswer(var3430, var2037)!false> <#assign isQ5None = true> <#else> <#assign score = score + calcScore(var3430)> </#if> <#assign isQ5Complete = true> </#if> </#if> </#if> <#assign isComplete = false>  <#if isQ2Complete && isQ3Complete && isQ4Complete && isQ5Complete> <#assign isComplete = true> </#if>  ${MODULE_TITLE_START} Traumatic Brain Injury (TBI) ${MODULE_TITLE_END}  ${MODULE_START} <#assign showRec = false> <#assign tbi_consult_text = \"\"> <#if isComplete && (var2047.children)?? && ((var2047.children)?size > 0) && isSelectedAnswer(var2047,var3442)> <#assign showRec = true> <#assign tbi_consult_text = \"You have requested further assessment\"> <#elseif isComplete && (var2047.children)?? && ((var2047.children)?size > 0) && isSelectedAnswer(var2047,var3441)> <#assign showRec = true> <#assign tbi_consult_text = \"You have declined further assessment\"> </#if> A TBI is physical damage to your brain, caused by a blow to the head. Common causes are falls, fights, sports, and car accidents. A blast or shot can also cause TBI. ${LINE_BREAK} ${LINE_BREAK} <#if isComplete> <b>Results:</b>${NBSP} <#if (score >= 0) && (score <= 3)> negative screen <#elseif (score >= 4 )> at risk </#if> </#if> <#if isComplete && showRec> ${LINE_BREAK} <b>Recommendation:</b> ${tbi_consult_text}. <#elseif !isQ2Complete && !isQ3Complete && !isQ4Complete && !isQ5Complete> ${LINE_BREAK} <b>Recommendation:</b> Declined to be screened </#if> ${MODULE_END} ','2015-02-21 14:15:09',0,NULL,NULL,NULL),(308,8,'Depression','Veteran Summary PHQ 9 Depression Entry','<#include \"clinicalnotefunctions\">\n<#-- generated file. Do not change -->\n<#if getFormulaValue(var1599)?string != DEFAULT_VALUE >\n${MODULE_TITLE_START}Depression${MODULE_TITLE_END}\n${GRAPH_SECTION_START}\n ${GRAPH_BODY_START}\n{\"varId\":1599,\"title\":\"My Depression Score\",\"footer\":\"*a score of 10 or greater is a positive screen\",\"numberOfMonths\":12,\"score\":\"${getFormulaValue(var1599)}\",\"intervals\":{\"None\":0.0,\"Minimal\":1.0,\"Mild\":5.0,\"Moderate\":10.0,\"Moderately Severe\":15.0,\"Severe\":20.0},\"maxXPoint\":27.0,\"ticks\":[0.0,1.0,5.0,10.0,15.0,20.0,27.0]}\n ${GRAPH_BODY_END}\n${GRAPH_SECTION_END}\n${MODULE_START}\n<#-- NAME:Depression is when you feel  -->\n<#-- SECTION:1 -->\n<#-- SUMMARY:Depression is when you feel sad and hopeless for much of the time. It affects your body and thoughts, and interferes with daily life. There are effective treatments and resources for dealing with depression.   Recommendation:    -->\nDepression is when you feel sad and hopeless for much of the time. It affects your body and thoughts, and interferes with daily life. There are effective treatments and resources for dealing with depression. <br> <b>Recommendation: </b> <#-- NAME:if_dep_score_phq9 formula_nresult_-->\n<#-- SECTION:2 -->\n<#-- SUMMARY:dep_score_phq9 formula nresult  -->\n<#if (formulaHasNoResult(var1599)) >\n<#-- NAME:Veteran declined to respond  -->\n<#-- SECTION:2.1 -->\n<#-- SUMMARY:Veteran declined to respond  -->\nVeteran declined to respond\n<#elseif ( isDefined(getFormulaValue(var1599)) && getFormulaValue(var1599) < 10) >\n<#-- NAME:Contact a clinician if in the -->\n<#-- SECTION:2.2.1 -->\n<#-- SUMMARY:Contact a clinician if in the future if you ever feel you may have a problem with depression   -->\nContact a clinician if in the future if you ever feel you may have a problem with depression \n<#elseif ( isDefined(getFormulaValue(var1599)) && getFormulaValue(var1599) >= 10) >\n<#-- NAME:Ask your clinician for further-->\n<#-- SECTION:2.3.1 -->\n<#-- SUMMARY:Ask your clinician for further evaluation an