pairments - Help if you really arent sure what you need, but things just dont feel right You may ask to meet with a Transition Case Manager today to discuss any issues presented in this screen. You can also call the OEF/OIF/OND Care Management team at any point in the future for assistance. Their contact information is listed on your personalized summary.  -->\n<h3><b>Thank You!</b></h3><p>Please let the assistant know that you have completed your screen. They will provide you with a personalized summary of your screens. The results of this screen will be sent electronically to a Transition Case Manager for review.</p><p>The goal of OEF/OIF/OND Care Management is to help you maximize your VA services and benefits.</p><p>Here are some services that we provide:</p>- Care coordination and support with access to VA healthcare services benefits<br>- Advocacy to address post-deployment health concerns<br>- Resources to address employment, education or housing concerns<br>- Applying for VA, other government, and community benefits<br>- Resources for marriage, family, and spirituality concerns<br>- Aid with concerns about drinking or drug use<br>- Assistance if you are feeling sad, depressed or anxious<br>- Assistance with visual impairments<br>- Help if you really arent sure what you need, but things just dont feel right <p>You may ask to meet with a Transition Case Manager today to discuss any issues presented in this screen. You can also call the OEF/OIF/OND Care Management team at any point in the future for assistance. Their contact information is listed on your personalized summary.</p>\n${MODULE_END}\n','2015-02-21 14:15:12',0,'[{\"summary\":\"Thank You!Please let the assistant know that you have completed your screen. They will provide you with a personalized summary of your screens. The results of this screen will be sent electronically to a Transition Case Manager for review.The goal of OEF/OIF/OND Care Management is to help you maximize your VA services and benef