et, you will be given a summary of your results.Your answers will be sent electronically to your nurse and provider for review.If you have any questions about your assessment, you will have the opportunity to speak with a nurse or your provider during your appointment. \",\"name\":\"Thank you!Please keep the tabl\",\"section\":\"1\",\"children\":[],\"contents\":[{\"type\":\"text\",\"content\":\"<h3>Thank&nbsp;you!</h3><p>Please&nbsp;keep&nbsp;the&nbsp;tablet&nbsp;with&nbsp;you&nbsp;until&nbsp;you&nbsp;are&nbsp;called&nbsp;for&nbsp;your&nbsp;Primary&nbsp;Care&nbsp;appointment.</p><p>At&nbsp;that&nbsp;time,&nbsp;return&nbsp;the&nbsp;tablet&nbsp;to&nbsp;the&nbsp;nursing&nbsp;staff&nbsp;in&nbsp;return&nbsp;for&nbsp;your&nbsp;identification&nbsp;card.</p><p>After&nbsp;you&nbsp;return&nbsp;the&nbsp;tablet,&nbsp;you&nbsp;will&nbsp;be&nbsp;given&nbsp;a&nbsp;summary&nbsp;of&nbsp;your&nbsp;results.</p><p>Your&nbsp;answers&nbsp;will&nbsp;be&nbsp;sent&nbsp;electronically&nbsp;to&nbsp;your&nbsp;nurse&nbsp;and&nbsp;provider&nbsp;for&nbsp;review.</p><p>If&nbsp;you&nbsp;have&nbsp;any&nbsp;questions&nbsp;about&nbsp;your&nbsp;assessment,&nbsp;you&nbsp;will&nbsp;have&nbsp;the&nbsp;opportunity&nbsp;to&nbsp;speak&nbsp;with&nbsp;a&nbsp;nurse&nbsp;or&nbsp;your&nbsp;provider&nbsp;during&nbsp;your&nbsp;appointment.</p>\"}],\"type\":\"text\"}]','2015-03-09 14:43:07',NULL),(341,10,'Assessment Welcome',NULL,'<#include \"clinicalnotefunctions\">\n<#-- generated file. Do not change -->\n${MODULE_START}\n<#-- NAME:Welcome to VA San Diego Health-->\n<#-- SECTION:1 -->\n<#-- SUMMARY:Welcome to VA San Diego Health Care System Primary Care Clinic!We thank you for your service to our country and we look forward to assisting you with your healthcare needs.The following eScreening Questionnaire will help your Primary Care Clinic Team to better assess your needs and provide you with better, more comprehensive care.Please complete the following questions to the best of your ability.  -->\n<h3>Welcome${NBS