 http://www.veteranshealthlibrary.org/.</p>\n${MODULE_END}\n','2015-05-11 17:14:46',0,'[{\"summary\":\"For confidential help and support any time, call the Veterans Suicide Prevention/Crisis Hotline at (800) 273-8255. The Hotline is always open to take your call, even on holidays and in the middle of the night.When you develop a health concern and have questions about whether you need to see a healthcare provider right away, call the VA Tele-Care Nurse Advice line 1-877-252-4866 or 858-552-4343 to get immediate recommendations regarding your care.For online information about support services and benefits, visit the VA Center of Excellence resource site at http://escreening.cesamh.org.If you are interested in learning more about your medical condition or ways to improve your health, the Veterans Health Library is an excellent source of information.  The Library can be accessed at http://www.veteranshealthlibrary.org/. \",\"name\":\"End of Escreening Summary Shee\",\"section\":\"1\",\"children\":[],\"contents\":[{\"type\":\"text\",\"content\":\"For confidential help and support any time, call the Veterans Suicide Prevention/Crisis Hotline at (800) 273-8255. The Hotline is always open to take your call, even on holidays and in the middle of the night.<p>When you develop a health concern and have questions about whether you need to see a healthcare provider right away, call the VA Tele-Care Nurse Advice line 1-877-252-4866 or 858-552-4343 to get immediate recommendations regarding your care.</p><p>For online information about support services and benefits, visit the VA Center of Excellence resource site at http://escreening.cesamh.org.</p><p>If you are interested in learning more about your medical condition or ways to improve your health, the Veterans Health Library is an excellent source of information.  The Library can be accessed at http://www.veteranshealthlibrary.org/.</p>\"}],\"type\":\"text\"}]','2015-05-11 10:14:46',NULL),(391,8,'Post-traumatic Stress Disorder'