ometry services</p>\n</#if>\n<#-- NAME:if_Do you want/need information or assistance with any of the following VA benefits?_response_VA Compensation-->\n<#-- SECTION:38 -->\n<#-- SUMMARY:Do you want/need information or assistance with any of the following VA benefits? response VA Compensation or Did you receive service-connected compensation for an injury? response 1552 -->\n<#if (responseIs(var250, 101))  ||  (responseIs(var1510, 1552) )  >\n<#-- NAME:*Encouraged the Veteran to mee-->\n<#-- SECTION:38.1 -->\n<#-- SUMMARY:*Encouraged the Veteran to meet with VSO for further advocacy and assistance with VA SCD claims process  provided VSO contact list  -->\n<p>*Encouraged the Veteran to meet with VSO for further advocacy and assistance with VA SCD claims process &amp; provided VSO contact list</p>\n</#if>\n<#-- NAME:if_Do you have an Advance Directive or Durable Power of Attorney for Healthcare?_response_No-->\n<#-- SECTION:39 -->\n<#-- SUMMARY:Do you have an Advance Directive or Durable Power of Attorney for Healthcare? response No or Would you like information about Advance Directive? response 391 -->\n<#if (responseIs(var820, 380))  ||  (responseIs(var826, 391) )  >\n<#-- NAME:*Provided VA Advance Directive-->\n<#-- SECTION:39.1 -->\n<#-- SUMMARY:*Provided VA Advance Directives brochure  form  -->\n<p>*Provided VA Advance Directives brochure &amp; form</p>\n</#if>\n<#-- NAME:*Educated the Veteran on avail-->\n<#-- SECTION:40 -->\n<#-- SUMMARY:*Educated the Veteran on available VA mental health services (including outpatient general and specialty psychiatry clinics, PTSD and MST services, Anger Management, CORE, and Family MH Clinic)*Provided the Veteran information on the VA Vet Centers services*Educated the Veteran on alcohol and drug treatment services and reviewed ADTP walk-in hours  location*Alerted the PCP to the Veteran medical/health concerns  requests*Directed the Veteran to Primary Care Call center for appointment scheduling*Provided VA environmental regi