yone who was a problem drinker or alcoholic or who used street drugs?',1187,NULL,NULL,'2015-04-08 17:59:43'),(72476,2,'ACE6','Yes',NULL,7874,NULL,'2015-04-08 17:59:43'),(72477,2,'ACE6','No',NULL,7875,NULL,'2015-04-08 17:59:43'),(72478,1,'ACE9','Was a household member depressed or mentally ill, or did a household member attempt suicide?',1188,NULL,NULL,'2015-04-08 17:59:43'),(72479,2,'ACE6','Yes',NULL,7876,NULL,'2015-04-08 17:59:43'),(72480,2,'ACE6','No',NULL,7877,NULL,'2015-04-08 17:59:43'),(72481,1,'ACE10','Did a household member go to prison?',1189,NULL,NULL,'2015-04-08 17:59:43'),(72482,2,'ACE6','Yes',NULL,7878,NULL,'2015-04-08 17:59:43'),(72483,2,'ACE6','No',NULL,7879,NULL,'2015-04-08 17:59:43'),(72484,1,'','While you were growing up, during your first 18 years of life:',1190,NULL,NULL,'2015-04-08 17:59:43'),(72485,1,'','<p>We are interested in finding out about the kinds of physical activities that people do as a part of their everyday lives. The questions will ask you about the time you spent being physically active in the <b><u>last 7 days</u></b>. Please answer each question even if you do not consider yourself to be an active person. Please think about the activities you do at work, as a part of your house and yard work, to get from place to place, and in your spare time for recreation, exercise or sport. <br></p>',1191,NULL,NULL,'2015-04-08 18:07:05'),(72486,1,'PAQ1','During the last 7 days, on how many days did you do vigorous physical activities like heavy lifting, digging, aerobics, or fast bicycling? (days per week)',1192,NULL,NULL,'2015-04-08 18:08:51'),(72487,2,'',NULL,NULL,7880,NULL,'2015-04-08 18:08:51'),(72488,1,'PAQ1','Days per week',1193,NULL,NULL,'2015-04-08 18:21:35'),(72489,2,'PAQ1','0',NULL,7881,NULL,'2015-04-08 18:21:35'),(72490,2,'PAQ1','1',NULL,7882,NULL,'2015-04-08 18:21:35'),(72491,2,'PAQ1','2',NULL,7883,NULL,'2015-04-08 18:21:35'),(72492,2,'PAQ1','3',NULL,7884,NULL,'2015-04-08 18:21:35'),(72493,2,'PAQ1','4',NULL,7885,NULL,'2015-04-08 1