physical activities that you did for at least 10 minutes at a time.</p>',1203,NULL,NULL,'2015-04-08 18:46:33'),(72511,1,'','<p>Think about all the <b>moderate</b> activities that you did in the last <b>7 days</b>. <b> Moderate </b>activities refer to activities that take moderate physical effort and make you breathe somewhat harder than normal.  Think only about those physical activities that you did for at least 10 minutes at a time.</p>',1204,NULL,NULL,'2015-04-08 18:48:27'),(72514,1,'','<p>During the <b>last 7 days</b>, on how many days did you do <b>moderate</b> physical activities like carrying light loads, bicycling at a regular pace, or doubles tennis?  Do not include walking.</p>',1207,NULL,NULL,'2015-04-08 18:49:31'),(72515,1,'IPAQ3_moddays','Days per week',1208,NULL,NULL,'2015-04-08 18:50:08'),(72516,2,'IPAQ3',NULL,NULL,7893,NULL,'2015-04-08 18:50:08'),(72517,1,'','<p>How much time did you usually spend doing <b>moderate</b> physical activities on one of those days?</p>',1209,NULL,NULL,'2015-04-08 18:50:53'),(72518,1,'IPAQ4_modhours','Hours per day',1210,NULL,NULL,'2015-04-08 18:51:21'),(72519,2,'IPAQ4',NULL,NULL,7894,NULL,'2015-04-08 18:51:21'),(72520,1,'IPAQ4_modmin','Minutes per day',1211,NULL,NULL,'2015-04-08 18:51:49'),(72521,2,'IPAQ4',NULL,NULL,7895,NULL,'2015-04-08 18:51:49'),(72522,1,'','<p>Think about the time you spent <b>walking</b> in the <b>last 7 days</b>.  This includes at work and at home, walking to travel from place to place, and any other walking that you have done solely for recreation, sport, exercise, or leisure.</p>',1212,NULL,NULL,'2015-04-08 18:52:25'),(72523,1,'','<p>During the l<b>ast 7 days</b>, on how many days did you <b>walk</b> for at least 10 minutes at a time?</p>',1213,NULL,NULL,'2015-04-08 18:53:12'),(72524,1,'IPAQ5_walkdays','Days per week',1214,NULL,NULL,'2015-04-08 18:53:50'),(72525,2,'IPAQ5',NULL,NULL,7896,NULL,'2015-04-08 18:53:50'),(72526,1,'IPAQ6_walkhours','Hours per day',1215,NULL,NULL,'2015-04-08 18:55:54'),(72